import moment from 'moment'
import React from 'react'

class OrderbookGraph extends React.Component {
    render() {
		const data = {
			datasets: [
				{
					label: 'Bid', 
					data: [1,2,3,4],
					steppedLine: 'before',
					borderColor: "#00ff00"
				}
			]
		}
		const options = {
			maintainAspectRatio: false
		}


 		console.log(data)
		return (
			<Line width={200} height={200} data={data} options={options}
            />
		)
	}
}

export default OrderbookGraph
